#include <iostream>
#include <vector>
#include <stack>

using namespace std;

/*
Given an array of integers arr, find the sum of min(b), where b ranges over every (contiguous) 
subarray of arr. Since the answer may be large, return the answer modulo (10^9 + 7).

Brute force approach: (worked right but failed because of time limit exceeding)
use inner loop
Time complexity: O(n^2)
Input: [1, 3, 4, 2]
In each inner loop get the minimum and add that to the result sum;

V2 better algorithms (memorization)
    I save [min_element] of each starting point of the subarrays
    Space complexity of the is O(n) because we can have at most n starting points of subarrays.

    When we reach each element I add min index to the sum. 
    if new more smaller element comes to the array I add that too.

    Time complexity O(n*(n/2))
*/

using ll = long long;
const int MOD = 1e9 + 7;

class Solution {
public:
    int sumSubarrayMins(vector<int>& nums) {
        int length = nums.size();
        vector<int> left(length, -1);
        vector<int> right(length, length);
        stack<int> stk;

        for (int i = 0; i < length; ++i) {
            while (!stk.empty() && nums[stk.top()] >= nums[i]) {
                stk.pop();
            }
            if (!stk.empty()) {
                left[i] = stk.top();
            }
            stk.push(i);
        }
        stk = stack<int>();

        for (int i = length - 1; i >= 0; --i) {
            while (!stk.empty() && nums[stk.top()] > nums[i]) {
                stk.pop();
            }
            if (!stk.empty()) {
                right[i] = stk.top();
            }
            stk.push(i);
        }

        ll sum = 0;

        for (int i = 0; i < length; ++i) {
            sum += static_cast<ll>(i - left[i]) * (right[i] - i) * nums[i] % MOD;
            sum %= MOD;
        }

        return sum;
    }
};

